import React from 'react'

export default () => {

    const componentStyle = {
        width: '100%',
        backgroundColor: '#373737',
        padding: '10px',
        height: '5vh',
    }

    const linkStyle = {
        padding: '5px',
        color: '#fff',
        textDecoration: 'none',
    }

    const titleStyle = {
        color: '#fff',
        fontWeight: 'bold',
        marginRight: '1em',
    }

  return (
    <nav style={componentStyle}>
        <span style={titleStyle}>ElectionMaster</span>
    </nav>
  )
}
